import React from 'react';
import { Link } from 'react-router-dom';
function navbar() {
        return (
            <div>
           <nav>
              <Link to = "/" >Home</Link><br />
              <Link to = "/contact" >Contact</Link>
              <Link to = "/login" >Login</Link>
           </nav>
           </div>
        );
    
}

export default navbar;
